import React, { useState } from "react";
import axios from "axios";

const BACKEND_URL =
  process.env.REACT_APP_BACKEND_URL ||
  "https://tenderbidding-2.onrender.com";

export default function Home() {
  const [file, setFile] = useState(null);
  const [result, setResult] = useState(null);
  const [section, setSection] = useState(null);
  const [loading, setLoading] = useState(false);

  const processTender = async () => {
    if (!file) {
      alert("Please upload a tender PDF");
      return;
    }

    const formData = new FormData();
    formData.append("file", file);

    try {
      setLoading(true);
      const res = await axios.post(
        `${BACKEND_URL}/process_tender_pdf`,
        formData,
        { headers: { "Content-Type": "multipart/form-data" } }
      );
      setResult(res.data);
      setSection("summary");
    } catch (err) {
      alert("Tender processing failed");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ padding: 24 }}>
      {/* Upload Card */}
      <div
        style={{
          maxWidth: 640,
          margin: "0 auto",
          background: "#f3eef9",
          padding: 28,
          borderRadius: 16,
          boxShadow: "0 12px 30px rgba(0,0,0,0.15)",
        }}
      >
        <h2>Upload Your Tender Document</h2>

        <input
          type="file"
          className="input"
          style={{ marginTop: 10 }}
          onChange={(e) => setFile(e.target.files[0])}
        />

        <button
          className="button"
          style={{ width: "50%", marginTop: 16 }}
          onClick={processTender}
          disabled={loading}
        >
          {loading ? "Processing..." : "Generate Tender Summary"}
        </button>
      </div>

      {/* Action Buttons */}
      {result && (
        <div
          style={{
            display: "flex",
            gap: 16,
            justifyContent: "center",
            marginTop: 28,
            flexWrap: "wrap",
          }}
        >
          <button
            className="button secondary"
            onClick={() => setSection("profile")}
          >
            View Quick Profile Summary
          </button>

          <button
            className="button secondary"
            onClick={() => setSection("bidding")}
          >
            Get Bid Recommendations
          </button>

          <button
            className="button"
            onClick={() => setSection("proposal")}
          >
            Generate Final Proposal PDF
          </button>
        </div>
      )}

      {/* Output Sections */}
      {result && section && (
        <div
          className="card"
          style={{
            marginTop: 30,
            maxWidth: 900,
            marginInline: "auto",
          }}
        >
          {section === "summary" && (
            <>
              <h3>Tender Summary</h3>
              <pre className="small">
                {JSON.stringify(result.summary || result, null, 2)}
              </pre>
            </>
          )}

          {section === "profile" && (
            <>
              <h3>Quick Profile Summary</h3>
              <ul className="small">
                <li>Product Match: {result.product_name || "N/A"}</li>
                <li>Quantity: {result.quantity || "N/A"}</li>
                <li>Location: {result.location || "N/A"}</li>
                <li>Match Score: {result.match_score || "N/A"}</li>
              </ul>
            </>
          )}

          {section === "bidding" && (
            <>
              <h3>Bid Recommendations</h3>
              <ul className="small">
                <li>Base Price: ₹{result.pricing?.base_price}</li>
                <li>Logistics Cost: ₹{result.pricing?.logistics}</li>
                <li>
                  Final Bid: ₹{result.pricing?.price_final}
                </li>
                <li>
                  Estimated Win Probability: ~52%
                </li>
              </ul>
            </>
          )}

          {section === "proposal" && (
            <>
              <h3>Final Proposal Generated</h3>
              <p className="small">
                Proposal PDF has been generated successfully and is
                ready for submission.
              </p>
              <p className="small">
                (For demo: PDF generation handled by backend)
              </p>
            </>
          )}
        </div>
      )}
    </div>
  );
}
